description:
The setting is Sheffield England, once the &quot;City of Steel&quot;, home of a massive steel industry and jobs aplenty. Today with the industry in decline and the steelworks closed down there is widespread unemployment and despair. Two unemployed friends stumble upon a Chippendales-like show that's very popular with the local women. Eventually they decide they too would like to give it a go, but they can't dance and aren't what most would call good physical specimens. They have their doubts but are determined to give it a shot. On their way they pick up four other unlikely candidates and begin practising for the big night. To drum up interest, they boast they'll go 'the full monty' (a phrase meaning 'all the way' - nude), something they hadn't planned and aren't sure they can deliver. Will they ?, won't they ?, can they keep their antics from their families ?, can they stay out of trouble ? can they pull a crowd ?. All will be revealed, well maybe.

Won Oscar.



